/*Table structure for table `account_details` */

DROP TABLE IF EXISTS `account_details`;

CREATE TABLE `account_details` (
  `accID` int NOT NULL AUTO_INCREMENT,
  `accFirstname` varchar(255) DEFAULT NULL,
  `accLastname` varchar(255) DEFAULT NULL,
  `accEmailAddress` varchar(255) DEFAULT NULL,
  `accUsername` varchar(255) DEFAULT NULL,
  `accPassword` varchar(255) DEFAULT NULL,
  `accQuestion` varchar(255) DEFAULT NULL,
  `accType` varchar(255) DEFAULT 'User',
  `accAnswer` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`accID`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

/*Data for the table `account_details` */

