/*Table structure for table `reservations` */

DROP TABLE IF EXISTS `reservations`;

CREATE TABLE `reservations` (
  `resID` int NOT NULL AUTO_INCREMENT,
  `resFullname` varchar(255) DEFAULT NULL,
  `resPhone` varchar(255) DEFAULT NULL,
  `resAttendees` varchar(255) DEFAULT NULL,
  `resTime` varchar(255) DEFAULT NULL,
  `resDate` date DEFAULT NULL,
  `resFee` varchar(255) DEFAULT NULL,
  `resInclusions` varchar(255) DEFAULT NULL,
  `resStatus` varchar(255) DEFAULT NULL,
  `accID` int DEFAULT NULL,
  `resUnpaidFee` int DEFAULT NULL,
  `resDmgFee` int DEFAULT NULL,
  PRIMARY KEY (`resID`),
  KEY `fk_accID` (`accID`),
  CONSTRAINT `fk_accID` FOREIGN KEY (`accID`) REFERENCES `account_details` (`accID`)
) ENGINE=InnoDB AUTO_INCREMENT=78 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

